const cdsj6StudentsSchoolusers = []

const generateCDSJ6StudentsSchoolusers = (uuid, ctx) => {
  usersData.forEach((user, index) => {
    cdsj6StudentsSchoolusers.push({
      ...user,
      email: `${user.username}@student.cdsj6.edu.mo`,
      id: uuid(),
      is_student: true,
      is_admin: false,
      groups: ['student'],
      created_at: new Date(),
      user_id: ctx.users.obj[user.username].id,
      school_id: ctx.schools.obj['school-cdsj6'].id
    })
  })
  return cdsj6StudentsSchoolusers
}

const cdsj6StudentsUsers = []

const generateCDSJ6StudentsUsers = (uuid) => {
  usersData.forEach((user, index) => {
    cdsj6StudentsUsers.push(
      {
        ...user,
        email: `${user.username}@student.cdsj6.edu.mo`,
        id: uuid(),
        is_admin: false,
        groups: ['student'],
        created_at: new Date()
      }
    )
  })

  return cdsj6StudentsUsers
}

module.exports = {
  usersData,
  cdsj6StudentsSchoolusers,
  generateCDSJ6StudentsSchoolusers,
  cdsj6StudentsUsers,
  generateCDSJ6StudentsUsers
}
